import reactDom from "react-dom";
import React from "react";

import {
    Input, Form, Button
} from 'reactstrap';

function InputForm(props) {
    return (
        <Form className="d-flex flex-nowrap">
            <Input ></Input>
            <Button className="ml-2"></Button>
        </Form>
    );
}

export default InputForm;
